import React from 'react';

class List extends React.Component{

    constructor(props) {
        super(props);
        this.state = {
            items: []
        }
    }

    getList() {
        fetch("http://localhost:8080/demo/list")
            .then(res => res.json())
            .then(
                (result) => {
                    this.setState({
                        items: result.items
                    })
                }
            )
    }

    render() {
        return (
            <div>
                <p>Hello World!</p>
            </div>
        )
    }
}

export default List;
